import React from "react";

const Footer = () => {
  return (
    <div>
      <footer>
        <h4>
          Build with ❤️ & ☕ by{" "}
          <a
            style={{
              textDecoration: "underline",
              color: "white",
            }}
            href="https://jatiinyadav.github.io"
            target="_blank"
            rel="noreferrer"
          >
            Jatin Yadav
          </a>
        </h4>
      </footer>
    </div>
  );
};

export default Footer;
